			shellScript = "#  Build the doxygen documentation for the project and load the docset into Xcode.\n#  If the DOXYGEN_PATH is not correct for you please check the \"Get Info\" for this\n#  target, the majority of variables for this script have been defined there.\n#\n#  Use the following to adjust the value of the $DOXYGEN_PATH User-Defined Setting:\n#    Binary install location: /Applications/Doxygen.app/Contents/Resources/doxygen\n#    Source build install location: /usr/local/bin/doxygen\n\n#  If the config file doesn't exist, run 'doxygen -g $SOURCE_ROOT/doxygen.config' to \n#   a get default file.\n\nif [ -z $DOXYGEN_PATH ]\nthen\n  echo You must set the DOXYGEN_PATH variable in the Docs target\n  exit 1\nfi\n\nif [ -z $OUTPUT_DIRECTORY ]\nthen\n  echo You must set the OUTPUT_DIRECTORY variable in the Docs target\n  exit 1\nfi\n\nif [ -z $DOXYGEN_CONFIG ]\nthen\n  echo You must set the DOXYGEN_CONFIG variable in the Docs targe\n  exit 1\nfi\n\nif [ -z $DOCSET_BUNDLE_ID ]\nthen\n  echo You must set the DOCSET_BUNDLE_ID variable in the Docs target\n  exit 1\nfi\n\nif ! [ -f $SOURCE_ROOT/$DOXYGEN_CONFIG ] \nthen \n  echo doxygen config file does not exist\n  $DOXYGEN_PATH -g $SOURCE_ROOT/$DOXYGEN_CONFIG\nfi\n\n#  Append the proper input/output directories and docset info to the config file.\n#  This works even though values are assigned higher up in the file. Easier than sed.\n\ncp $SOURCE_ROOT/$DOXYGEN_CONFIG $TEMP_DIR/doxygen.config\n\nif ! [ -d $SOURCE_ROOT/$OUTPUT_DIRECTORY ]\nthen\n  mkdir -p $SOURCE_ROOT/$OUTPUT_DIRECTORY\nfi\n\necho \"INPUT = $SOURCE_ROOT\" >> $TEMP_DIR/doxygen.config\necho \"OUTPUT_DIRECTORY = $SOURCE_ROOT/$OUTPUT_DIRECTORY\" >> $TEMP_DIR/doxygen.config\necho \"GENERATE_DOCSET        = YES\" >> $TEMP_DIR/doxygen.config\necho \"DOCSET_BUNDLE_ID       = $DOCSET_BUNDLE_ID\" >> $TEMP_DIR/doxygen.config\n\n#  Run doxygen on the updated config file.\n#  Note: doxygen creates a Makefile that does most of the heavy lifting.\n\n$DOXYGEN_PATH $TEMP_DIR/doxygen.config\n\n#  make will invoke docsetutil. Take a look at the Makefile to see how this is done.\n\nmake -C $SOURCE_ROOT/$OUTPUT_DIRECTORY/html install\n\n#  Construct a temporary applescript file to tell Xcode to load a docset.\n\nrm -f $TEMP_DIR/loadDocSet.scpt\n\necho \"tell application \\\"Xcode\\\"\" >> $TEMP_DIR/loadDocSet.scpt\necho \"load documentation set with path \\\"/Users/$USER/Library/Developer/Shared/Documentation/DocSets/\\\"\" \n     >> $TEMP_DIR/loadDocSet.scpt\necho \"end tell\" >> $TEMP_DIR/loadDocSet.scpt\n\n#  Run the load-docset applescript command.\n\nosascript $TEMP_DIR/loadDocSet.scpt\n\nexit 0";
